class TranslationsModel {
  TranslationsModel({Info? info, Words? words}) {
    _info = info;
    _words = words;
  }

  TranslationsModel.fromJson(dynamic json) {
    _info = json['info'] != null ? Info.fromJson(json['info']) : null;
    _words = json['words'] != null ? Words.fromJson(json['words']) : null;
  }

  Info? _info;
  Words? _words;

  TranslationsModel copyWith({Info? info, Words? words}) =>
      TranslationsModel(info: info ?? _info, words: words ?? _words);

  Info? get info => _info;

  Words? get words => _words;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_info != null) {
      map['info'] = _info?.toJson();
    }
    if (_words != null) {
      map['words'] = _words?.toJson();
    }
    return map;
  }
