/// id : "en"
/// name : "English"
/// direction : "ltr"
/// author : "hasanen@snono-systems.com"
/// font : "Arial"

class Info {
  Info({
    String? id,
    String? name,
    String? direction,
    String? author,
    String? font,
  }) {
    _id = id;
    _name = name;
    _direction = direction;
    _author = author;
    _font = font;
  }

  Info.fromJson(dynamic json) {
    _id = json['id'];
    _name = json['name'];
    _direction = json['direction'];
    _author = json['author'];
    _font = json['font'];
  }

  String? _id;
  String? _name;
  String? _direction;
  String? _author;
  String? _font;

  Info copyWith({
    String? id,
    String? name,
    String? direction,
    String? author,
    String? font,
  }) => Info(
    id: id ?? _id,
    name: name ?? _name,
    direction: direction ?? _direction,
    author: author ?? _author,
    font: font ?? _font,
  );

  String? get id => _id;

  String? get name => _name;

  String? get direction => _direction;

  String? get author => _author;

  String? get font => _font;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['name'] = _name;
    map['direction'] = _direction;
    map['author'] = _author;
    map['font'] = _font;
    return map;
  }
}
